import React from 'react';
import PropTypes from 'prop-types';
//componente funcional

const Button=({ type, text, cliklHandler})=>{
    return(
        <button className={type} onClick={()=>{
            console.log("Boton precionado")
            cliklHandler(text)
        }}>
            <span>
                {text}
            </span>
        </button>
    )
}
